import React, { Component } from "react";
import "./ToDo.css";
import DoList from "./DoList";

export default class ToDo extends Component {
  handleAddCard() {
    return 1;
  }

  render() {
    return (
      <div className="todo-wrapper">
        <div className="todo">
          <DoList onAddCardClick={handleAddCard} name="Notes"></DoList>
          <DoList name="Today"></DoList>
          <DoList name="Goals"></DoList>
        </div>
      </div>
    );
  }
}
